import Intro from "./components/Intro/Intro";
import About from "./components/About/About";
import PortfolioList from "./components/PortfolioList/PortfolioList";
import Contact from "./components/Contact/Contact";

const App = () => {
  return (
    <div>
      <Intro />
      <About />
      <PortfolioList />
      <Contact />
    </div>
  );
};

export default App;
